import React, { useEffect, useState } from "react";

const PostProfiles = ({ auth, id, dispatch, profile }) => {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    profile.userPosts.forEach((data) => {
      if (data._id === id) {
        setPosts(data.posts);
      }
    });
  }, [profile.userPosts, id]);

  console.log(posts);

  return (
    <>
      <div className="post-profile-contanier">

      </div>
    </>
  );
};

export default PostProfiles;
